import s from "./SaleCenter.module.css";

const SaleCenter = () => {
    return (
        <div className={s.sale_center}>
            <div className={s.sale_center_container}>
                <div className={s.sale_center_left}>
                    <ul className={s.sale_center_left_up}>
                        <li></li>
                        <li></li>
                    </ul>
                </div>
            </div>
        </div>
    )
}
export default SaleCenter
